import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <ul className="nav nav-pills">
      <li className="nav-item">
        <NavLink className="nav-link">Dashboard</NavLink>
      </li>
      <li className="nav-item">
        <NavLink className="nav-link">Ingestion</NavLink>
      </li>
      <li className="nav-item">
        <NavLink className="nav-link">Configuration</NavLink>
      </li>
      <li className="nav-item">
        <NavLink className="nav-link">Execution</NavLink>
      </li>
      <li className="nav-item">
        <NavLink className="nav-link">Views</NavLink>
      </li>
    </ul>
  );
};

export default Navbar;
